import React, { useEffect, useState } from "react"
import Header from "../components/Header"
import axios from "axios";

export default function Signup() {
    const [response, setResponse] = React.useState(null);

    async function handleSubmit(e) {
        e.preventDefault()
        const formData = getFormData()
        const register_url = 'http://127.0.0.1:8000/accounts/api/auth/register/'

        useEffect(() => {
            axios.post(register_url, formData).then(
                response => {
                    setProduct(response.data)
                }
            )
        }, [register_url])
        console.log(response)
    }

    function getFormData() {
        const username = document.getElementById('username').value
        const email = document.getElementById('email').value
        const password = document.getElementById('password').value
        const formData = {
            username: username,
            email: email,
            password: password
        }
        return formData
    }

    return (
        <div className="signup-page">
            <form name="signup-form" onSubmit={handleSubmit}>
                <input type="text" className="username" id="username" name="username" placeholder="Username" spellCheck="false" />
                <input type="text" className="email" id="email" name="email" placeholder="Email" spellCheck="false" />
                <input type="text" className="password" id="password" name="password" placeholder="Password" spellCheck="false" />
                <input type="submit" className="submit" value="SIGN UP" />
            </form>
        </div>
    )
}
